#include "string"
#include "iostream"
#include "algorithm"
using namespace std;

// Class: Mixed solution
// Description:
//  - If size is small, use sort. Otherwise count the appearance of each character.
// Creat: Yangyao Chen, 2018/10/18
// Note:
//   The value according to which the method is separated may depend on the system, compiler and state of computer.
//   You may use large set of tests to determine the best value.
class Solution {
public:
    bool isAnagram(string s, string t) {
        if( s.size() != t.size() ) return false;
        if( s.size() < 25 ) return sortedWay(s,t);
        return countWay(s,t);
    }
    bool sortedWay(string &s, string &t){
        std::sort(s.begin(), s.end());
        std::sort(t.begin(), t.end());
        return s == t;
    }
    bool countWay(string &s, string &t){
        int ct[26] = {0};
        for( auto c: s ) ++ct[ c-'a' ];
        for(auto c: t) --ct[ c-'a' ];
        return !any_of( ct, ct+26, [](int x)->bool{return x;} );
    }
};


int main(int argc, char const *argv[]){
    Solution sol;
    string s = "";
    string t = "";

    cout << sol.isAnagram(s,t) << endl;

    return 0;
}
